import React from "react";
import {
  withScriptjs,
  withGoogleMap,
  GoogleMap,
  Marker
} from "react-google-maps";

const Map = withScriptjs(
  withGoogleMap(props =>
    console.log(props)(
      <GoogleMap
        defaultZoom={8}
        defaultCenter={{
          lat: props.startLocation.lat,
          lng: props.startLocation.lng
        }}
        onClick={props.handleClickedMap}
      >
        {console.log(props.markers)}
        {props.isMarkerShown &&
          props.markers.map(marker => (
            <Marker
              position={{
                lat: marker.latitude,
                lng: marker.longtitude
              }}
            />
          ))}
      </GoogleMap>
    )
  )
);

export default Map;

